WNAME_L96:"L96",BF3_ID_P_XP1_WNAME_MG36:"MG36",BF3_ID_P_XP1_WNAME_PP19:"PP-19",BF3_ID_P_XP1_WNAME_QBB95:"QBB-95",BF3_ID_P_XP1_WNAME_QBU88:"QBU-88",BF3_ID_P_XP1_WNAME_QBZ95B:"QBZ-95B",BF3_ID_P_XP1_XP1_WNAME_FAMAS:"FAMAS",BF3_ID_P_XP1_XPACK_DESC_01:"死亡せずに、アサルトライフル、ジェット機、戦車で1キルを達成する",BF3_ID_P_XP1_XPACK_DESC_02:"BTR-90、DPV、F-35でそれぞれ1キルを達成する",BF3_ID_P_XP1_XPACK_DESC_03:"10種類の「Back to Karkand」武器を使って、それぞれ10キルを達成する",BF3_ID_P_XP1_XPACK_DESC_04:"スキッドローダーで1キルを達成する",BF3_ID_P_XP1_XPACK_DESC_05:"オマーンホテルのプールでおよぐ",BF3_ID_P_XP1_XPACK_NAME_01:"コンプリートウォリアー",BF3_ID_P_XP1_XPACK_NAME_02:"3度目のツアー",BF3_ID_P_XP1_XPACK_NAME_03:"ガンスリンガー",BF3_ID_P_XP1_XPACK_NAME_04:"ボスのように",BF3_ID_P_XP1_XPACK_NAME_05:"ジョーズ",BF3_ID_P_XP2_PREMIUM_WDESC_KNIFE_RAZOR:"アドバンスド・コンバットナイフ・モデル90は、シャープな刃を備え耐久性にも優れたコンバットナイフ。刃の一部はのこぎり状に加工されているほか、先端にはガットフックが施されている。背後から敵に接近すれば、ナイフで音を立てずに素早く倒す事ができ、倒した敵のドッグタグも入手できる。正面から数回切りつけても敵を倒せるが、ドッグタグの獲得はできない。",BF3_ID_P_XP2_PREMIUM_WNAME_KNIFE_RAZOR:"ACB-90",BF3_ID_P_XP2_WDESC_ACR:"汎用性の高いこのコンバット・ライフルは、最新ライフルの機能を数多く備えた、軽量かつ多機能なライフルである。反動の小さい最新の“グレンデル”弾を使用するほか、極端な悪天候にも耐える構造を備え、標準的なSTANAGマガジンにも対応。軍隊と警察の両方で求められる様々な役割を果たすことができる。",BF3_ID_P_XP2_WDESC_HK417:"M416をスケールアップした本銃は、厚みを増した16インチのバレルと、7.62mm弾を使用するために拡大されたレシーバーを備えている。その高い精度とストッピングパワーはスナイパーライフルとして理想的であり、世界中の多くの軍隊で配備されている。",BF3_ID_P_XP2_WDESC_JNG90:"大型のマズルブレーキが特徴的なJNG-90は、トルコ軍の標準スナイパーライフルとして配備されている。この最新型ライフルには、一体型のレールシステムに加えて多彩なアクセサリーが用意されており、状況に合わせて装着できる。強力なストッピングパワーを誇るだけでなく、MOA精度にも優れている。",BF3_ID_P_XP2_WDESC_L86A1:"イギリスのSA80シリーズに属するこのライフルは、小規模な歩兵部隊の火力支援用として開発された。バレルが延長されており、有効射程も長くなっている。本来は軽機関銃として開発されたものだが、長射程における優れた性能に着目され、マークスマン任務に使用されるようになった。ベルト給弾式ではないため連続射撃には向かないが、その安定した命中精度はあらゆる分隊にとって大きな戦力となる。",BF3_ID_P_XP2_WDESC_LSAT:"小火器や弾薬の重量を大幅に抑えることを目標に開発された、米軍JSSAPのプロトタイプ。この試作型の軽機関銃には、高発火点の発射薬が充填されたベルト給弾式ケースレス弾が使用される。開発プログラムが成功すれば、このシステムは現在配備されている重く扱いにくい分隊火器を置き換え、大きな進歩をもたらすだろう。",BF3_ID_P_XP2_WDESC_MP5K:"世界で最も評価の高いサブマシンガンの一つをベースにしたタクティカル・マシンピストル。ショルダー・ストックを省いてレシーバーを短縮した非常にコンパクトな個人防衛火器であり、高い連射速度を持ち、近距離において強力なストッピングパワーを発揮する。",BF3_ID_P_XP2_WDESC_MTAR21:"イスラエル軍に標準配備されているTAR-21ライフルを極限までコンパクトにした、ブルパップ方式のカービン。人間工学的に優れ、全長は590mm（23.2インチ）と扱いやすくなっている。標準的な長さのライフルには向かない、狭い場所での戦闘を想定している。2009年からはIDFの標準ライフルとして配備され、世界各国の治安部隊や警察で採用されている。",BF3_ID_P_XP2_WDESC_SCARL:"SCARライフルシステムのモジュールは様々なものに換装可能で、中でもMk16こと“SCAR-L”は14インチのバレルと30発マガジンを備えている。20発マガジンを持つ大口径のMk17カービンと比べると、SCAR-Lは長いバレルにより長距離での目標捕捉が容易で、反動が抑えられているために安定した射撃が可能である。",BF3_ID_P_XP2_WDESC_SPAS12:"1980年代に登場したイタリア製の特徴的なショットガンで、市場では大きな成功を収めた。様々な弾薬を使用できるため、世界中で高い支持を集めている。SPAS-12はその独特な構造のマガジンによって様々な弾薬が使用できることから、現在でも世界中の警察や軍隊で高い評価を受けている。",BF3_ID_P_XP2_WDESC_STEYRAUG:"この5.56mmブルパップ方式のライフルは、1970年代に開発された。高度にモジュール化されている一方で、非常に扱いやすい。1977年にオーストラリア軍の標準ライフルとして採用されて以降、国際市場でも大きな成功を収め、その耐久性と扱いやすさは世界各地で高く評価されている。",BF3_ID_P_XP2_WNAME_ACR:"ACW-R",BF3_ID_P_XP2_WNAME_HK417:"M417",BF3_ID_P_XP2_WNAME_JNG90:"JNG-90",BF3_ID_P_XP2_WNAME_L86A1:"L86A2",BF3_ID_P_XP2_WNAME_LSAT:"LSAT",BF3_ID_P_XP2_WNAME_MP5K:"M5K",BF3_ID_P_XP2_WNAME_MTAR21:"MTAR-21",BF3_ID_P_XP2_WNAME_SCARL:"SCAR-L",BF3_ID_P_XP2_WNAME_SPAS12:"SPAS-12",BF3_ID_P_XP2_WNAME_STEYRAUG:"AUG A3",BF3_ID_P_XP2_XPACK_DESC_01:"コンクエストドミネーションを1ラウンド勝利する",BF3_ID_P_XP2_XPACK_DESC_02:"ガンマスターを1ラウンドクリアする",BF3_ID_P_XP2_XPACK_DESC_03:"Ziba Towerの端から落ちる",BF3_ID_P_XP2_XPACK_DESC_04:"死亡することなく、カービン、ピストル、ロケットランチャーで各1キルを達成する",BF3_ID_P_XP2_XPACK_DESC_05:"10種類すべてのCQ武器で、各10キルを達成する",BF3_ID_P_XP2_XPACK_NAME_01:"ドミネーター",BF3_ID_P_XP2_XPACK_NAME_02:"マン・オブ・キャリバー",BF3_ID_P_XP2_XPACK_NAME_03:"スカイダイビング",BF3_ID_P_XP2_XPACK_NAME_04:"デッドリー・ツールズ",BF3_ID_P_XP2_XPACK_NAME_05:"力の誇示",BF3_ID_P_XP3_XPACK_DESC_01:"ガンシップで1キルを達成する",BF3_ID_P_XP3_XPACK_DESC_02:"ガンシップを撃破する",BF3_ID_P_XP3_XPACK_DESC_03:"4輪バギーで1キルを達成する",BF3_ID_P_XP3_XPACK_DESC_04:"タンク・シューペリオリティで、1ラウンドに勝利する",BF3_ID_P_XP3_XPACK_DESC_05:"戦車駆逐車と自走砲のそれぞれで、10キルを達成する",BF3_ID_P_XP3_XPACK_NAME_01:"頭上からの死",BF3_ID_P_XP3_XPACK_NAME_02:sn,BF3_ID_P_XP3_XPACK_NAME_03:"オフロード",BF3_ID_P_XP3_XPACK_NAME_04:"シューペリオリティ",BF3_ID_P_XP3_XPACK_NAME_05:"デストロイヤー",BF3_ID_P_XP4_WDESC_CROSSBOW:"クロスボウは様々な種類のボルトを使用できる。",BF3_ID_P_XP4_WNAME_CROSSBOW_KOBRA:"クロスボウ",BF3_